import React from 'react';

const Thumb = (props) => {
    console.log(props.sku)
    return (
        <div className={props.classes}>
            <img style={{width: "250px"}}
            src={`../../images/${props.src.sku}_1.jpg`} 
            alt={props.src.name} />
        </div>
    )
}

export default Thumb;
